mapper.select:
SELECT

FROM
    rgdb."UeT0511NenkinTokuchoKaifuJoho" AS 年金特徴回付情報
WHERE
    年金特徴回付情報."gyomuCode" = 'DB'

        AND 年金特徴回付情報."shoriNendo" = #{前年度の賦課年度}


        AND 年金特徴回付情報."shoriNendo" = #{賦課年度}

    AND 年金特徴回付情報."tsuchiNaiyoCode" = #{通知内容コード}
    AND 年金特徴回付情報."hosokuTsuki" = #{処理対象月の4カ月前}

mapper.update:
UPDATE
    rgdb."DbT7022ShoriDateKanri"
SET "kijunTimestamp" = #{処理日時},
    "updateCount" = "updateCount" + 1,
    "lastUpdateTimestamp" = CURRENT_TIMESTAMP
WHERE
    "subGyomuCode" = 'DBB'
    AND "shoriName" = #{処理名}
    AND "nendo" = #{賦課年度}
    AND "nendoNaiRenban" = #{年度内連番}

mapper.select:
SELECT
    処理日付管理マスタ."kijunTimestamp" 
FROM
    rgdb."DbT7022ShoriDateKanri" AS 処理日付管理マスタ
WHERE
    "subGyomuCode" = 'DBB'
    AND "shoriName" = #{処理名}
    AND "nendo" = #{賦課年度}
    AND "nendoNaiRenban" = #{年度内連番}

mapper.sql:
WITH master AS ( SELECT 処理日付管理マスタ."taishoShuryoTimestamp" AS 対象開始日時 FROM rgdb."DbT7022ShoriDateKanri" AS 処理日付管理マスタ WHERE 処理日付管理マスタ."subGyomuCode" = 'DBB' AND 処理日付管理マスタ."shoriName" = #{処理名}
AND 処理日付管理マスタ."nendo" = #{前年度の賦課年度}
AND 処理日付管理マスタ."nendo" = #{賦課年度}
ORDER BY 処理日付管理マスタ."taishoShuryoTimestamp" DESC LIMIT 1 )
